    static class SolutionII extends WallsAndGates {
    	public static final int INF = Integer.MAX_VALUE;
        public void wallsAndGates(int[][] rooms) {
            if (rooms.length == 0 || rooms[0].length == 0)
                return;
            int rows = rooms.length, cols = rooms[0].length;
            Integer[][] counts = new Integer[rows][cols];
            for (int r = 0; r < rows; r++) {
                for (int c = 0; c < cols; c++) {
                    bfs(rooms, r, c, counts);
                }
            }
            for (int r = 0; r < rows; r++) {
                for (int c = 0; c < cols; c++) {
                    if (rooms[r][c] != -1)
                        rooms[r][c] = counts[r][c];
                }
            }
        }
        
        private static final int[][] dirs = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};
        private int bfs(int[][] rooms, int r, int c, Integer[][] counts) {
if (r == 2 && c == 2)
	System.out.println();
            Integer count = counts[r][c];
            if (count != null)
                return count;
                
            count = INF;
            counts[r][c] = INF; // ERROR
            if (rooms[r][c] == 0) {
                count = 0;
            } else {
                for (int[] dir : dirs) {
                    int r1 = r + dir[0], c1 = c + dir[1];
                    if (r1 >= 0 && r1 < rooms.length && c1 >= 0 && c1 < rooms[0].length && rooms[r1][c1] != -1) {
                        int sub = bfs(rooms, r1, c1, counts);
                        if (sub != INF) {
                            count = Math.min(count, sub + 1);
                        }
                    }
                }
            }
            
            counts[r][c] = count;
            return count;
        }
    }
    
    
    static class SolutionI extends WallsAndGates {
    	private static final int[][] dirs = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};
        public void wallsAndGates(int[][] rooms) {
            if (rooms.length == 0 || rooms[0].length == 0)
                return;
            int rows = rooms.length, cols = rooms[0].length;
            List<int[]> empties = new LinkedList<>();
            for (int r = 0; r < rows; r++) {
                for (int c = 0; c < cols; c++) {
                    if (rooms[r][c] == Integer.MAX_VALUE)
                        empties.add(new int[]{r, c});
                }
            }
            for (int[] empty : empties) {
                boolean[][] used = new boolean[rows][cols];
                int r = empty[0], c= empty[1];
                used[r][c] = true;
                rooms[r][c] = bfs(empty, used, rooms);
            }
        }
        
        private int bfs(int[] p0, boolean[][] used, int[][] rooms) {
            int rows = rooms.length, cols = rooms[0].length;
            List<int[]> list = Arrays.asList(p0);
            int count = 0;
            while (!list.isEmpty()) {
                List<int[]> nextList = new LinkedList<>();
                for (int[] p : list) {
                    int r = p[0], c = p[1];
                    for (int[] dir : dirs) {
                        int r1 = r + dir[0], c1 = c + dir[1];
                        if (r1 >= 0 && r1 < rows && c1 >= 0 && c1 < cols && rooms[r1][c1] != -1 && !used[r1][c1]) {
                            if (rooms[r1][c1] == 0)
                                return count+1;
                            used[r1][c1] = true;
                            nextList.add(new int[]{r1, c1});
                        }
                    }
                }
                list = nextList;
                count++;
            }
            
            return Integer.MAX_VALUE;
        }
    }

